import React from 'react';
import './Dashboard.css'; // Make sure you have the corresponding CSS file

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>OVERVIEW</h1>
      <div className="priority-tasks">
        <h2>PRIORITY TASKS</h2>
        {/* Task list component or HTML goes here */}
      </div>
      <div className="analytics-calendar-container">
        <div className="task-analytics">
          <h2>TASK ANALYTICS</h2>
          {/* Analytics chart component or HTML goes here */}
        </div>
        <div className="calendar-view">
          <h2>CALENDAR</h2>
          {/* Calendar component or HTML goes here */}
        </div>
      </div>
      <div className="view-reports">
        {/* This could be a link or button to view reports */}
        <button>View reports here</button>
      </div>
    </div>
  );
};

export default Dashboard;
